import React from 'react';
import '../../../Screens/HomeScreen.css'
import MenChinos from './MenChinos';
import MenChinosData from './MenChinosData';

export default function MenChinosScreen() {
    return (
        <div>
            <div className="row center">
  {MenChinosData.Chinos.map((product)=>
   <MenChinos key = {product._id} product ={product}></MenChinos>
  )
  }
 </div>
        </div>
    )
}
